Mathew Kearney (born December 1, 1978) is an American musician born in Eugene, Oregon, now based in Nashville, Tennessee. Kearney has received critical acclaim and widespread recognition for his Columbia Records debut, Nothing Left to Lose. So far, he has a total of four top 20 hits on the Adult Top 40 Chart.

His most recent album, Young Love, was released on August 2nd, 2011. The album's first single, &quot;Hey Mama,&quot; was released on May 10, 2011.



Young Love is the fourth studio album from Nashville singer/songwriter, Mat Kearney. It was released on August 2, 2011, although some who pre-purchased the album through Mat Kearney's site received it as early as July 29. The album's first single, &quot;Hey Mama,&quot; was released on May 10, 2011 as a digital download. The album's track listing, artwork, and release date were revealed on June 13, 2011. Over the months leading up to this, Kearney released several videos of his studio sessions. These videos revealed that this album features the rap style that could be heard on Nothing Left to Lose but not City of Black and White. Kearney described it as being a &quot;return to innocence.&quot; Blinking Lights and Intimate Things was considered as an alternate album title. It debuted at four on the Billboard 200, a new chart high and best sales week ever, with 44,000 copies sold.

